Aneks nr 12 z dnia 30.09.2024 r. - W związku ze stwierdzeniem konieczności zaniechania części robót i wykonania robót dodatkowych oraz rozszerzających zakres,  których nie można było przewidzieć na etapie opracowywania dokumentów wyjściowych niezbędnych do realizacji zadania, w celu wykonania pełnego zakresu zadania określonego w zatwierdzonym Programie Inwestycji, na podstawie:
1)	Protokołu konieczności Nr 26/51148/19/2024, zatwierdzonego w dniu 15.07.2024 r.  - prace objęte zakresem przedmiotowego Protokołu konieczności - Instalacje elektryczne sieci zewnętrzne, instalacje elektryczne, instalacje telekomunikacyjne - instalacje i systemy teletechniczne, system alarmowy SSWIN, system sygnalizacji pożarowej SSP, telewizyjny system nadzoru CCTV, system kontroli dostępu SKD, system wykrywania węglowodorów i etanolu; 
2)	Protokołu konieczności Nr 31/51148/20/2024, z zakresem rzeczowym zatwierdzonym w dniu 19.09.2024 r. - prace objęte zakresem przedmiotowego Protokołu konieczności - Instalacje paliwowe, bud nr 01, 02, 06 i 09 - architektura i konstrukcja, bocznica kolejowa, drogi, instalacje i sieci sanitarne;
3)	Protokołu konieczności Nr 33/51148/21/2024, zatwierdzonego w dniu 23.09.2024 r.  - prace objęte zakresem przedmiotowego Protokołu konieczności są zaleceniami do wykonania wynikającymi z przeprowadzonych w dniach 23 – 31.07.2024 r. przez Delegaturę Wojskowej Ochrony Przeciwpożarowej w Lublinie czynności kontrolno-rozpoznawczych związanych z ochroną ppoż. składu MPS (notatka z dnia 01.08.2024 r.) zwiększono wynagrodzenie wykonawcy - zmiana na podstawie art. 455 ust. 1 pkt 1 i pkt 4 ustawy z dnia 11 września 2019 r. Prawo zamówień publicznych.

1. W związku ze stwierdzeniem konieczności zaniechania części robót i wykonania robót dodatkowych oraz rozszerzających zakres,  których nie można było przewidzieć na etapie opracowywania dokumentów wyjściowych niezbędnych do realizacji zadania, w celu wykonania pełnego zakresu zadania określonego w zatwierdzonym Programie Inwestycji, na podstawie:
1)	Protokołu konieczności Nr 26/51148/19/2024, zatwierdzonego w dniu 15.07.2024 r.  - prace objęte zakresem przedmiotowego Protokołu konieczności - Instalacje elektryczne sieci zewnętrzne, instalacje elektryczne, instalacje telekomunikacyjne - instalacje i systemy teletechniczne, system alarmowy SSWIN, system sygnalizacji pożarowej SSP, telewizyjny system nadzoru CCTV, system kontroli dostępu SKD, system wykrywania węglowodorów i etanolu; 
2)	Protokołu konieczności Nr 31/51148/20/2024, z zakresem rzeczowym zatwierdzonym w dniu 19.09.2024 r. - prace objęte zakresem przedmiotowego Protokołu konieczności - Instalacje paliwowe, bud nr 01, 02, 06 i 09 - architektura i konstrukcja, bocznica kolejowa, drogi, instalacje i sieci sanitarne;
3)	Protokołu konieczności Nr 33/51148/21/2024, zatwierdzonego w dniu 23.09.2024 r.  - prace objęte zakresem przedmiotowego Protokołu konieczności są zaleceniami do wykonania wynikającymi z przeprowadzonych w dniach 23 – 31.07.2024 r. przez Delegaturę Wojskowej Ochrony Przeciwpożarowej w Lublinie czynności kontrolno-rozpoznawczych związanych z ochroną ppoż. składu MPS (notatka z dnia 01.08.2024 r.) zawarto aneks nr 12 do umowy z dnia 30.09.2024 r. - zmiana na podstawie art. 455 ust. 1 pkt 1 i pkt 4 ustawy z dnia 11 września 2019 r. Prawo zamówień publicznych. 
2. Wartość przedmiotu umowy z wyłączeniem części przedmiotu umowy związanej z prawem opcji po zmianie (zwiększenie wynagrodzenia): 98 816 295,77 zł netto (bez VAT), 121 544 043,80 zł brutto.
